/********************************************************************
* FUNCTION u_microwave_model_wire_interface_pac_edit
* 
* Edit database object callback
* Path: /wire-interface-pac
* Add object instrumentation in COMMIT phase.
* 
* INPUTS:
*     see agt/agt_cb.h for details
*     k_ parameters are ancestor list key values.
* 
* RETURNS:
*     error status
********************************************************************/
status_t u_microwave_model_wire_interface_pac_edit (
    ses_cb_t *scb,
    rpc_msg_t *msg,
    agt_cbtyp_t cbtyp,
    op_editop_t editop,
    val_value_t *newval,
    val_value_t *curval,
    const xmlChar *k_wire_interface_pac_layer_protocol)
{
    status_t res = NO_ERR;
    xmlChar dateAndTime[256];
    time_t t = time(NULL);
    struct tm tm = *localtime(&t);
    struct timeval tv;
    int millisec;
    xmlChar *obj_id_ref[XPATH_MAX_LENGTH];
    xmlChar *attr_name[XPATH_MAX_LENGTH];
    xmlChar* new_value[XPATH_MAX_LENGTH];
    
    gettimeofday(&tv, NULL);
    millisec = lrint(tv.tv_usec/1000.0); // Round to nearest millisec
    if (millisec>=1000)
    { // Allow for rounding up to nearest second
        millisec -=1000;
        tv.tv_sec++;
        millisec /= 100;
    }
    sprintf(dateAndTime, "%04d-%02d-%02dT%02d:%02d:%02d.%01dZ",
    tm.tm_year + 1900, tm.tm_mon + 1, tm.tm_mday,
    tm.tm_hour, tm.tm_min, tm.tm_sec, millisec/100);
    sprintf(attr_name, "wire-interface-pac");
    sprintf(obj_id_ref, "%s",
        k_wire_interface_pac_layer_protocol);

    if (LOGDEBUG) {
        log_debug("\nEnter u_microwave_model_wire_interface_pac_edit callback for %s phase",
            agt_cbtype_name(cbtyp));
    }

    switch (cbtyp) {
    case AGT_CB_VALIDATE:
        /* description-stmt validation here */
        break;
    case AGT_CB_APPLY:
        /* database manipulation done here */
        break;
    case AGT_CB_COMMIT:
        /* device instrumentation done here */
        switch (editop) {
        case OP_EDITOP_LOAD:
            break;
        case OP_EDITOP_MERGE:
            u_microwave_model_attribute_value_changed_notification_send(attribute_value_changed_counter++,
            dateAndTime, obj_id_ref, attr_name, new_value);
            break;
        case OP_EDITOP_REPLACE:
            u_microwave_model_attribute_value_changed_notification_send(attribute_value_changed_counter++,
            dateAndTime, obj_id_ref, attr_name, new_value);
            break;
        case OP_EDITOP_CREATE:
            break;
        case OP_EDITOP_DELETE:
            break;
        default:
            res = SET_ERROR(ERR_INTERNAL_VAL);
        }
        break;
    case AGT_CB_ROLLBACK:
        /* undo device instrumentation here */
        break;
    default:
        res = SET_ERROR(ERR_INTERNAL_VAL);
    }
    return res;

} /* u_microwave_model_wire_interface_pac_edit */


